INSERT INTO `npc_text` SET `ID`=9825,`prob0`=1,`text0_0`='',`text0_1`='<Tears stream down Greatmother Geyah''s face.>$B$BI... I... Durotan survived to have a child? The child Draka told me of before they left... It was their greatest fear... To raise a child in this world. On the other side of that gate was their only hope. I dared not tell Durotan, but secretly, I begged the spirits to watch over them - to protect their child and to give them strength.$B$BI... I must see my grandchild. I must see him. Please, I am too weak. You must tell him. Before I leave this world...
