INSERT INTO `npc_text` SET `ID`=16624,`prob0`=1,`text0_0`='We''ve been hearing reports of elemental disturbances around Azeroth for some time now. Our sources indicate that the phenomenon is not entirely natural, but we haven''t quite been able to determine the source. We have some theories though, but nothing concrete.$B$BKeep your eye out for any suspicious elemental activity as you walk around.  If you find anything worthwhile, please let an Earthen Ring Emissary know. You can find us in any capital city.$B$BBe careful out there.  Trouble is brewing.',`text0_1`='We''ve been hearing reports of elemental disturbances around Azeroth for some time now. Our sources indicate that the phenomenon is not entirely natural, but we haven''t quite been able to determine the source. We have some theories though, but nothing concrete.$B$BKeep your eye out for any suspicious elemental activity as you walk around.  If you find anything worthwhile, please let an Earthen Ring Emissary know. You can find us in any capital city.$B$BBe careful out there.  Trouble is brewing.',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0,`prob1`=0,`text1_0`='',`text1_1`='',`lang1`=0,`em1_0`=0,`em1_1`=0,`em1_2`=0,`em1_3`=0,`em1_4`=0,`em1_5`=0,`prob2`=0,`text2_0`='',`text2_1`='',`lang2`=0,`em2_0`=0,`em2_1`=0,`em2_2`=0,`em2_3`=0,`em2_4`=0,`em2_5`=0,`prob3`=0,`text3_0`='',`text3_1`='',`lang3`=0,`em3_0`=0,`em3_1`=0,`em3_2`=0,`em3_3`=0,`em3_4`=0,`em3_5`=0,`prob4`=0,`text4_0`='',`text4_1`='',`lang4`=0,`em4_0`=0,`em4_1`=0,`em4_2`=0,`em4_3`=0,`em4_4`=0,`em4_5`=0,`prob5`=0,`text5_0`='',`text5_1`='',`lang5`=0,`em5_0`=0,`em5_1`=0,`em5_2`=0,`em5_3`=0,`em5_4`=0,`em5_5`=0,`prob6`=0,`text6_0`='',`text6_1`='',`lang6`=0,`em6_0`=0,`em6_1`=0,`em6_2`=0,`em6_3`=0,`em6_4`=0,`em6_5`=0,`prob7`=0,`text7_0`='',`text7_1`='',`lang7`=0,`em7_0`=0,`em7_1`=0,`em7_2`=0,`em7_3`=0,`em7_4`=0,`em7_5`=0, `WDBVerified`=12340;
INSERT INTO `npc_text` SET `ID`=16625,`prob0`=1,`text0_0`='The elements in Azeroth are becoming more disturbed each passing day.  The key to this disturbance lies here, in Nagrand.  When Draenor was torn apart, all of the elemental planes were thrown into great turmoil and have never recovered.  The rifts here form naturally and are a sign of a severely damaged world.$B$BTo see this same kind of disruption on Azeroth is not just unnerving, it could be a precursor to a type of destruction the world has never seen before.$B$B$n, bring me any information you may find when walking around Outland.$B$BI must spend time with the elements here, researching a way to calm the elements again in Azeroth...before it''s too late.',`text0_1`='',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0,`prob1`=0,`text1_0`='',`text1_1`='',`lang1`=0,`em1_0`=0,`em1_1`=0,`em1_2`=0,`em1_3`=0,`em1_4`=0,`em1_5`=0,`prob2`=0,`text2_0`='',`text2_1`='',`lang2`=0,`em2_0`=0,`em2_1`=0,`em2_2`=0,`em2_3`=0,`em2_4`=0,`em2_5`=0,`prob3`=0,`text3_0`='',`text3_1`='',`lang3`=0,`em3_0`=0,`em3_1`=0,`em3_2`=0,`em3_3`=0,`em3_4`=0,`em3_5`=0,`prob4`=0,`text4_0`='',`text4_1`='',`lang4`=0,`em4_0`=0,`em4_1`=0,`em4_2`=0,`em4_3`=0,`em4_4`=0,`em4_5`=0,`prob5`=0,`text5_0`='',`text5_1`='',`lang5`=0,`em5_0`=0,`em5_1`=0,`em5_2`=0,`em5_3`=0,`em5_4`=0,`em5_5`=0,`prob6`=0,`text6_0`='',`text6_1`='',`lang6`=0,`em6_0`=0,`em6_1`=0,`em6_2`=0,`em6_3`=0,`em6_4`=0,`em6_5`=0,`prob7`=0,`text7_0`='',`text7_1`='',`lang7`=0,`em7_0`=0,`em7_1`=0,`em7_2`=0,`em7_3`=0,`em7_4`=0,`em7_5`=0, `WDBVerified`=12340;
