INSERT INTO `npc_text` SET `ID`=17057,`prob0`=1,`text0_0`='Your time is coming to an end.',`text0_1`='Your time is coming to an end.',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0,`prob1`=1,`text1_0`='Gloat all you want, but you''ll see we were right.',`text1_1`='Gloat all you want, but you''ll see we were right.',`lang1`=0,`em1_0`=0,`em1_1`=0,`em1_2`=0,`em1_3`=0,`em1_4`=0,`em1_5`=0,`prob2`=1,`text2_0`='I may be restrained now, but my master will set me free when his vengeance rains down upon this city.',`text2_1`='I may be restrained now, but my master will set me free when his vengeance rains down upon this city.',`lang2`=0,`em2_0`=0,`em2_1`=0,`em2_2`=0,`em2_3`=0,`em2_4`=0,`em2_5`=0,`prob3`=1,`text3_0`='I am on the path to ascension and no petty, aspiring hero is going to stop me.',`text3_1`='I am on the path to ascension and no petty, aspiring hero is going to stop me.',`lang3`=0,`em3_0`=0,`em3_1`=0,`em3_2`=0,`em3_3`=0,`em3_4`=0,`em3_5`=0,`prob4`=1,`text4_0`='It is your life that will end soon; mine is just beginning.',`text4_1`='It is your life that will end soon; mine is just beginning.',`lang4`=0,`em4_0`=0,`em4_1`=0,`em4_2`=0,`em4_3`=0,`em4_4`=0,`em4_5`=0,`prob5`=1,`text5_0`='By the time you realize the truth, it will be too late.',`text5_1`='By the time you realize the truth, it will be too late.',`lang5`=0,`em5_0`=0,`em5_1`=0,`em5_2`=0,`em5_3`=0,`em5_4`=0,`em5_5`=0,`prob6`=0,`text6_0`='',`text6_1`='',`lang6`=0,`em6_0`=0,`em6_1`=0,`em6_2`=0,`em6_3`=0,`em6_4`=0,`em6_5`=0,`prob7`=0,`text7_0`='',`text7_1`='',`lang7`=0,`em7_0`=0,`em7_1`=0,`em7_2`=0,`em7_3`=0,`em7_4`=0,`em7_5`=0, `WDBVerified`=12340;
